import React, {useState} from "react";
import {useDispatch, useSelector} from "react-redux";
import Button from "@material-ui/core/Button/Button";
import {getEmailUs} from "../actions/emailUs.action";
import {appConstants} from "../constants/constant";
import {getTr} from "../actions/tr.action";
import TableCell from "@material-ui/core/TableCell/TableCell";
import TableRow from "@material-ui/core/TableRow/TableRow";
import TableHead from "@material-ui/core/TableHead/TableHead";
import Table from "@material-ui/core/Table/Table";
import TableContainer from "@material-ui/core/TableContainer/TableContainer";
import TableBody from "@material-ui/core/TableBody/TableBody";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import EnhancedTable from "./AdminTable";


const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
];


const AdminPage = () => {

    const classes = useStyles();

    const dispatch = useDispatch();

    const adminState = useSelector(appState => {
        return {
            eu: appState.eu,
            tr: appState.tr
        };
    });

    const getUnhandledEu = (event) => {
        event.preventDefault();
        dispatch(getEmailUs());

    };

    const getUnhandledTr = (event) => {
        event.preventDefault();
        dispatch(getTr());

    };


    const showEus = (event) => {
        event.preventDefault();
        console.log(adminState.eu[0]);

    };

    // {
    //     euState.eu.map((element) => {
    //         return <p>{element}</p>
    //     })
    // }

    {/*<p>{euState.eu[0].id}</p>*/}

    return (
        <div>
            <form>
                <button onClick = {getUnhandledEu}>getEu</button>
                {/*<button onClick = {showEus}>showEu</button>*/}
                {
                    adminState.eu ?
                        adminState.eu.map((element) => {
                            return <p>{element.id}</p>
                        })
                    :
                    <span></span>
                }

                <button onClick = {getUnhandledTr}>getTr</button>
                {
                    adminState.tr ?
                        adminState.tr.map((element) => {
                            return <p>{element.id}</p>
                        })
                        :
                        <span></span>
                }

            </form>
            <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>First Name</TableCell>
                            <TableCell align="right">Last Name</TableCell>
                            <TableCell align="right">Email</TableCell>
                            <TableCell align="right">Phone</TableCell>
                            <TableCell align="right">Date</TableCell>
                            <TableCell align="right">Status</TableCell>
                            <TableCell align="right">Message</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            adminState.eu ?
                                adminState.eu.map((element) => (
                                    <TableRow key={element.id}>
                                        <TableCell component="th" scope="row">
                                            {element.firstname}
                                        </TableCell>
                                        <TableCell align="right">{element.lastname}</TableCell>
                                        <TableCell align="right">{element.email}</TableCell>
                                        <TableCell align="right">{element.phone}</TableCell>
                                        <TableCell align="right">{element.date}</TableCell>
                                        <TableCell align="right">{element.status}</TableCell>
                                        <TableCell align="right">{element.message}</TableCell>
                                    </TableRow>
                                ))
                            :
                            <span></span>
                        }
                    </TableBody>
                </Table>

                <br/>
                <br/>

                <Table className={classes.table} aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell>First Name</TableCell>
                            <TableCell align="right">Last Name</TableCell>
                            <TableCell align="right">Email</TableCell>
                            <TableCell align="right">Phone</TableCell>
                            <TableCell align="right">SMS</TableCell>
                            <TableCell align="right">Time</TableCell>
                            <TableCell align="right">Date</TableCell>
                            <TableCell align="right">Status</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {
                            adminState.tr ?
                                adminState.tr.map((element) => (
                                    <TableRow key={element.id}>
                                        <TableCell component="th" scope="row">
                                            {element.firstname}
                                        </TableCell>
                                        <TableCell align="right">{element.lastname}</TableCell>
                                        <TableCell align="right">{element.email}</TableCell>
                                        <TableCell align="right">{element.phone}</TableCell>
                                        <TableCell align="right">{element.sms}</TableCell>
                                        <TableCell align="right">{element.time}</TableCell>
                                        <TableCell align="right">{element.date}</TableCell>
                                        <TableCell align="right">{element.status}</TableCell>
                                    </TableRow>
                                ))
                                :
                                <span></span>
                        }
                    </TableBody>
                </Table>


            </TableContainer>

        </div>

    );
};
export default AdminPage;


